const degToRad = Math.PI / 180;
const up = new THREE.Vector3(0, 1, 0);
const right = new THREE.Vector3(1, 0, 0);
const forward = new THREE.Vector3(0, 0, 1);

let lastPointerPos = new THREE.Vector2(0, 0);
let pointerPos = new THREE.Vector2(0, 0);
let pointerOffset = new THREE.Vector2(0, 0);

let isDragging = false;

const crystal = this;
let onmove = function (e) {

	if (e.preventDefault) e.preventDefault();

	let x = e.pageX || e.changedTouches[0].pageX;
	let y = e.pageY || e.changedTouches[0].pageY;

	pointerPos.set(x, y);
	pointerOffset.subVectors(pointerPos, lastPointerPos);

	crystal.rotateOnWorldAxis(up, pointerOffset.x * 0.005);
	crystal.rotateOnWorldAxis(right, pointerOffset.y * 0.005);

	lastPointerPos.copy(pointerPos);
}

let onend = function (e) {
	console.log("end");
	document.removeEventListener("pointermove", onmove);
	document.removeEventListener("touchmove", onmove);
	isDragging = false;
}

let onstart = function (e) {
	console.log("start");
	lastPointerPos.set(e.pageX, e.pageY);
	isDragging = true;

	document.addEventListener("pointermove", onmove, { passive: false });
	document.addEventListener("touchmove", onmove, { passive: false });
}

console.log(this);

document.onpointerdown = onstart;
document.onpointerup = onend;
document.ontouchend = onend;



function update( event ) {
	if (!isDragging && player.visibleOpacity && player.visibleOpacity > 0) {
		var normal = player.visibleNormal;

		var offset = new THREE.Vector2(normal.x, normal.y).multiplyScalar(0.1);
		var lerpVector = offset.clone().lerp(new THREE.Vector2(0, 0), 0.5);

		crystal.rotateOnWorldAxis(up, -lerpVector.x);
		crystal.rotateOnWorldAxis(right, lerpVector.y);
	}

	player.visibleNormal = forward.clone();
	player.visibleOpacity = -1;

}

