const forward = new THREE.Vector3(0, 0, 1);
this.material = this.material.clone()

function update( event ) {
	var worldNormal = forward.clone().transformDirection(this.matrixWorld);
	var opacity = worldNormal.dot(forward);

	opacity = Math.max(Math.min(opacity, 1), 0);

	opacity = Math.pow(opacity, 10);

	if (player.visibleOpacity && opacity > player.visibleOpacity) {
		player.visibleOpacity = opacity;
		player.visibleNormal.copy(worldNormal);
	}

	this.material.opacity = opacity;
}

